import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import { ScrollView } from 'react-native';
const useStyles = makeStyles((theme) => ({
    texttitle: {
        fontSize: '22.6px',
        fontWeight: 'bold',
        color: '#4A4A4A'
    },
    subTitle: {
        fontSize: '16.18px',
        color: '#4A4A4A'

    },
    frame: {
        width: "554px",
        height: "336px",
        backgroundColor: "#FFFFFF",
        position: "relative"

    },
    inner: {
        width: "464px",
        height: "249px",
        position: "relative",
        margin: 'auto'
    },
    superinner: {
        width: "363px",
        height: "170.6px",
        position: "relative",
        margin: 'auto',
    },
    linedivider: {
        backgroundColor: "#D8D8D8",
        height: "1px",
        width: "100%"
    }
}))

export default function DialogDetail() {
    const classes = useStyles()

    return (
        <div className={classes.frame}>
            <div style={{ height: 44 }} />
            <div className={classes.inner}>
                <div className={classes.texttitle}>
                    Set A
                </div>
                <div style={{ height: 22 }} />
                <div className={classes.linedivider}></div>
                <div style={{ height: 21 }} />

                <ScrollView>
                    <div className={classes.superinner}>

                        <div style={{ display: 'flex' }}>
                            <div className={classes.subTitle}>
                                Room price
                            </div>
                            <div className={classes.subTitle} style={{ position: "absolute", right: 63 }}>
                                4,000.00
                            </div>
                            <div className={classes.subTitle} style={{ position: "absolute", right: 0 }}>
                                THB
                            </div>
                        </div>
                        <div style={{ height: 12 }} />

                    </div>
                </ScrollView>

            </div>
        </div>
    )
}
